import logo from './logo.svg';
import './App.css';

function App() {
    fetch("http://localhost:8080/api/v1/bugs",{
        headers:{
            "Content-Type": "application/json",
            "Authorization":"Bearer eyJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJQb3BWYXMxMjMiLCJpYXQiOjE2ODM4MTczNjQsImV4cCI6MTY4MzgyMDk2NH0.6t51J-Y4wXz5oV8HnhiifwaufHnArS5j_q3NwEoj0Zs"
        }
    })
        .then(respone => respone.json())
        .then(respon => console.log(respon))
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo"/>
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
            </header>
        </div>
    );
}

export default App;
